    for (let i in obj) {
      if (obj[i] == undefined || obj[i] == null) {
        obj[i] = '';
      }
    }
    // this.SpinnerService.show();

    if (hint == 'next') {
      this.sprintpresentpage=this.sprintpresentpage + 1
      this.pipelineSummary(obj, this.sprintpresentpage)
    }
    else if (hint == 'previous') {
      this.sprintpresentpage=this.sprintpresentpage - 1
      this.pipelineSummary(obj, this.sprintpresentpage)
    }
    else {
      this.sprintpresentpage=1
